import React, { Component } from 'react'

class CategoryDashBoard extends Component {
    render() {
        return (
            <div>
                <p>{this.props.location.passlink.name}</p>
                <p>{this.props.location.passlink.link}</p>
            </div>
        )
    }
}

export default CategoryDashBoard
